import React from "react";
import NextApp, { AppContext } from "next/app";
import Meta from "../components/Meta";
import Header from "../components/Header";

interface IProps {
  pageProps: any;
}
class App extends NextApp<IProps> {
  render() {
    const { Component, pageProps } = this.props;

    return (
      <>
        <Meta />
        <Header />
        <Component {...pageProps} />
      </>
    );
  }
}

export default App;
